import styled from "styled-components";
import "./App.css";
import CompanyPage from "./Pages/CompanyPage";
import PersonPage from "./Pages/PersonPage";
import Footer from "./Widgets/Footer";
import HeaderMenu from "./Widgets/HeaderMenu";
import { Icon } from "./Widgets/svg/Icon";
// import { Icon } from "./Widgets/svg/Icon";

const MainConteiner = styled.div`
  margin: 80px auto;
  width: 648px;
  height: 696px;
  background-color: #f4f4f4;
  border-radius: 8px;
`;
function App() {
  return (
    <div className="App">
      <Icon id="rightArrow" className="main-icon" />
      <MainConteiner>
        <HeaderMenu />
        <PersonPage />
        <CompanyPage />
        <Footer />
      </MainConteiner>
    </div>
  );
}

export default App;
